import React from "react";
import { Link } from "react-router-dom";

const BugLineItem = (props) => {
  // console.log(props);

  const { bugId, bugTitle, bugPriority, bugDueDate, updated_at } = props.bug;
  const { url } = props.url;
  // TODO: need to add project status to everything
  // console.log(bugId, bugTitle, bugPriority, bugDueDate, updated_at);

  console.log(url);
  return (
    <tr>
      {/* {console.log(props.url)} */}
      <td>
        <Link key={bugId} to={`${props.url}/${props.bug.bugId}`}>
          {props.bug.bugId}
        </Link>
      </td>
      <td>{props.bug.bugTitle}</td>
      <td></td>- - Project ID: {props.bug.project_id}
    </tr>
  );
};

export default BugLineItem;
